// Tenta acessar o campo base64 dentro da estrutura da mensagem
const base64 = $input.first().json.body.data.message.base64
  || null;

if (!base64) {
  throw new Error("❌ Base64 da imagem não encontrado no JSON recebido!");
}

// Retorna o base64 em formato pronto pra conversão
return [
  {
    json: {
      imageBase64: base64,
      mimetype: $input.first().json.body.data.message.imageMessage.mimetype // ou "image/png" se mudar o formato depois
    }
  }
];

// Assume que o Base64 puro está em $json.base64_webp
const base64_webp_raw = $input.first().json.base64_webp;

if (base64_webp_raw) {
    // Remove todos os caracteres de espaço em branco (incluindo quebras de linha)
    const base64_clean = base64_webp_raw.replace(/\s/g, '');

    // Retorna a string limpa na mesma propriedade
    return [{
        json: {
            base64_webp: base64_clean
        }
    }];
}

// Se não encontrou, repasse o item original (embora não deva acontecer)
return $input.all();
